import React, { useState, useEffect } from "react";

export default function VisualizarDatos() {
  const [datos, setDatos] = useState([]);

  useEffect(() => {
    // Realiza la solicitud a la base de datos cuando el componente se monta
    obtenerDatos();
  }, []);

  async function obtenerDatos() {
    try {
      const response = await fetch("http://localhost:5000/datos"); // Cambia la URL por la ruta correcta de tu API
      const data = await response.json();
      setDatos(data);
    } catch (error) {
      console.error(error);
    }
  }

  return (
    <div>
      <h3>Datos en MongoDB:</h3>
      <ul>
        {datos.map((dato) => (
          <li key={dato._id}>{dato.nombre}</li>
        ))}
      </ul>
    </div>
  );
}
